vector<int> getZ(const string &s) {
  vector<int> z(s.size());
  int l = 0, r = 0;

  for(int i = 1; i < s.size(); ++i) {
    if(i < r) {
      z[i] = min(r - i, z[i - l]);
    }
    while(i + z[i] < s.size() && s[z[i]] == s[i + z[i]])
      z[i]++;
    if(i + z[i] > r) {
      l = i;
      r = i + z[i];
    }
  }
  return z;
}

void solve() {
  string s;
  while(cin >> s && s != ".") {
    auto z = getZ(s);
    int ans = 1;
    for(int i = 1; i < s.size(); ++i) 
      if(i + z[i] >= s.size() && (s.size() % i == 0)) {
        ans = s.size() / i;
        break;
      }
    cout << ans << '\n'; 
  }
}

