    BigInt operator+=(const BigInt& v) {
        if (sign == v.sign) {
            __internal_add(v);
        }
        else {
            if (__compare_abs(*this, v) >= 0) {
                __internal_sub(v);
            }
            else {
                BigInt vv = v;
                swap(*this, vv);
                __internal_sub(vv);
            }
        }
        return *this;
