public class MyResource : IDisposable
{
    private IntPtr handle;
    private Component component;
    private LargeObject largeObject;
    private bool isDisposed;
    private readonly object sync;

    public MyResource(IntPtr handle)
    {
        try
        {
            this.handle = handle;
            component = new Component();
            largeObject = new LargeObject();
            sync = new object();
        }
        // Ensure that errors in the constructor doesn't leak
        catch
        {
            component?.Dispose();
            CloseHandle(handle);
            isDisposed = true;
        }
    }

    [System.Runtime.InteropServices.DllImport("Kernel32")]
    private extern static Boolean CloseHandle(IntPtr handle);

    public void Dispose()
    {
    	lock (sync)
        {
            if (isDisposed) return;
            Dispose(true);
            isDisposed = true;
        }
        GC.SuppressFinalize(this);
    }

    ~MyResource()
    {
    	// sync may have become null in the finalizer.
    	if (sync is not null)
        {
          	lock (sync)
          	{
             	if (isDisposed) return;
             	Dispose(false);
              	isDisposed = true;
          	}
        }
        else
        {        
            if (disposed) return;
            Dispose(false);
            isDisposed = true;
        }
    }

    protected virtual void Dispose(bool disposing)
    {
        if (disposing)
        {
            component.Dispose();
            component = null;
            largeObject = null;
        }
        CloseHandle(handle);
        handle = IntPtr.Zero;
    }


    public int DoSomething()
    {
        lock (sync)
        {
            if (isDisposed) throw new ObjectDisposedException("handle");
            return ReadSomething(handle);
        }
    }

    public void DoSomethingElse()
    {
        lock (sync)
        {
            if (isDisposed) throw new ObjectDisposedException("component");
            component.DoStuff(largeObject);
        }
    }

    public void DoSomethingElse2()
    	=> Console.WriteLine("This method doesn't require resources");

    [System.Runtime.InteropServices.DllImport("Kernel32")]
    private extern static int ReadSomething(IntPtr handle);
}

// user-function to include in your script
// deletes all other contents of any type except the script itself
delete_all_other_contents()
{
    string thisScript = "name of notecard not to delete";
    string inventoryItemName;

    integer index = llGetInventoryNumber(INVENTORY_NOTECARD);
    while (index)
    {
        --index;        // (faster than index--;)

        inventoryItemName = llGetInventoryName(INVENTORY_NOTECARD, index);

        if (inventoryItemName != thisScript)   
            llRemoveInventory(inventoryItemName);     
    }
}

default
{
    state_entry()
    {
        delete_all_other_contents();
    }
}

